var flexItemProps = {
    flex: 'flex',
    flexGrow: 'flexGrow',
    flexShrink: 'flexShrink',
    flexBasis: 'flexBasis',
    justifySelf: 'justifySelf',
    alignSelf: 'alignSelf',
    order: 'order',
};
export function flexItem(props) {
    var styles = {};
    for (var key in props) {
        if (key in flexItemProps) {
            var attr = flexItemProps[key];
            var value = props[key];
            styles[attr] = value;
        }
    }
    return styles;
}
